const MenuBtn = ({className}) => {
    className = 'dropdown-toggle '+ className
    return (
        <a id="navbarDropdownMenuLink" role="button" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false" className={className} href="#">
           <i className='fas fa-bars'></i>
        </a>
    )
}

export default MenuBtn
